import React from "react";

import scrollDown from "../../img/scrollDown.png";
import LOGO from "../../img/LOGO.png";

import NavBox from "./NavBox";
import Portfolio from "./Portfolio";

const HomePage = () => {
  return (
    <div>
      <header id="home">
        <NavBox />
        <div className="row">
          <div>
            <p className="starter-text">Hi, I'm</p>
            <img src={LOGO} alt="logo" className="logo" />
            <p>a web developer</p>
            <a href="/portfolio" className="scrollto wow fadeInUp delay-5s ">
              <p className="scrollto-text">SEE MORE</p>
              <p className="scrollto--arrow">
                <img src={scrollDown} alt="scroll down arrow" />
              </p>
            </a>
          </div>
        </div>
      </header>
      <Portfolio />
    </div>
  );
};

export default HomePage;
